const Login = () => {
  return (
    <div className="login-container"> 
     <div className="live-chat">
     <img src={logo} alt="logo" className="image-container"/>
     <p>Aa raha hai na Mazaa, ab</p>

     </div>
     <div className="login-box">
       <h1>Main hoon don Yahan ka </h1>
     </div>
      
    </div>
  )
}

export default Login;
